import React, { useState, useEffect } from 'react';
import axios from 'axios';

const AdminDashboard = () => {
  const [formData, setFormData] = useState({
    brand: '',
    model: '',
    ram: '',
    storage: '',
    price: '',
    condition: '',
  });

  const [image, setImage] = useState(null);
  const [mobiles, setMobiles] = useState([]);

  // Fetch mobiles
  const fetchMobiles = async () => {
    try {
      const res = await axios.get('http://localhost:5000/api/mobiles');
      setMobiles(res.data);
    } catch (err) {
      console.error('Failed to fetch mobiles:', err);
    }
  };

  useEffect(() => {
    fetchMobiles();
  }, []);

  const handleChange = (e) => {
    setFormData((prev) => ({
      ...prev,
      [e.target.name]: e.target.value
    }));
  };

  const handleFileChange = (e) => {
    setImage(e.target.files[0]);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!image) {
      alert('Please select an image');
      return;
    }

    const token = localStorage.getItem('admin_token');
    const data = new FormData();
    data.append('image', image);
    Object.entries(formData).forEach(([key, value]) => {
      data.append(key, value);
    });

    try {
      await axios.post('http://localhost:5000/api/mobiles/upload', data, {
        headers: {
          'Content-Type': 'multipart/form-data',
          Authorization: `Bearer ${token}`,
        },
      });

      alert('✅ Mobile uploaded!');
      setFormData({
        brand: '',
        model: '',
        ram: '',
        storage: '',
        price: '',
        condition: '',
      });
      setImage(null);
      fetchMobiles();
    } catch (err) {
      console.error('Upload failed:', err);
      alert('❌ Upload failed');
    }
  };

  const handleDelete = async (id) => {
    const token = localStorage.getItem('admin_token');
    if (!window.confirm('Delete this mobile?')) return;

    try {
      await axios.delete(`http://localhost:5000/api/mobiles/${id}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      fetchMobiles();
    } catch (err) {
      console.error('Delete failed:', err);
      alert('❌ Delete failed');
    }
  };

  return (
    <div style={{ padding: '40px', fontFamily: 'sans-serif' }}>
      <h2>📤 Upload New Mobile</h2>
      <form onSubmit={handleSubmit} style={{ maxWidth: '400px', marginBottom: '40px' }}>
        <input type="file" name="image" onChange={handleFileChange} required /><br />
        <input type="text" name="brand" placeholder="Brand" value={formData.brand} onChange={handleChange} required /><br />
        <input type="text" name="model" placeholder="Model" value={formData.model} onChange={handleChange} required /><br />
        <input type="text" name="ram" placeholder="RAM (e.g., 4GB)" value={formData.ram} onChange={handleChange} /><br />
        <input type="text" name="storage" placeholder="Storage (e.g., 64GB)" value={formData.storage} onChange={handleChange} /><br />
        <input type="number" name="price" placeholder="Price" value={formData.price} onChange={handleChange} /><br />
        <input type="text" name="condition" placeholder="Condition (e.g., Good)" value={formData.condition} onChange={handleChange} /><br />
        <button type="submit" style={{ marginTop: '10px' }}>Upload</button>
      </form>

      <h2>📋 Uploaded Mobiles</h2>
      <div style={{ display: 'flex', flexWrap: 'wrap', gap: '20px' }}>
        {mobiles.map((mobile) => (
          <div key={mobile._id} style={{ border: '1px solid #ccc', padding: '10px', width: '220px' }}>
            <img
              src={mobile.imageUrl}
              alt={mobile.model}
              style={{ width: '100%', height: 'auto', objectFit: 'cover' }}
              onError={(e) => { e.target.src = '/fallback.jpg'; }}
            />
            <h4>{mobile.brand} - {mobile.model}</h4>
            <p>RAM: {mobile.ram}</p>
            <p>Storage: {mobile.storage}</p>
            <p>Price: ₹{mobile.price}</p>
            <p>Condition: {mobile.condition}</p>
            <button onClick={() => handleDelete(mobile._id)} style={{ color: 'red' }}>Delete</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default AdminDashboard;
